    }
  }

  defaultTestModeLogger (httpOptions, payload, formData) {
    const testlog = debug.enabled ? debug : console.log
    testlog('options: %o', httpOptions)
    testlog('payload: %o', payload)
    testlog('form: %o', formData)
  }
}

